package test

import (
	"encoding/hex"
	"encoding/json"
	"fmt"
	"github.com/GalaIO/P2Pcrawler/misc"
	"log"
	"testing"
)

func TestDecode(t *testing.T) {
	//raw := ""
	raw := ""

	bytes, err := hex.DecodeString(raw)
	if err != nil {
		log.Fatal(err)
	}

	dicts, err := misc.DecodeDict(string(bytes))
	if err != nil {
		log.Fatal(err)
	}

	body := dicts.GetDict("r")
	fmt.Println("id", hex.EncodeToString([]byte(body.GetString("id"))))
	fmt.Println("nodes", hex.EncodeToString([]byte(body.GetString("nodes"))))
}
func TestDecodev2(t *testing.T) {
	raw := ""

	bytes, err := hex.DecodeString(raw)
	if err != nil {
		log.Fatal(err)
	}

	dicts, next, err := misc.DecodeDictNoLimit(string(bytes))
	if err != nil {
		log.Fatal(err)
	}
	fmt.Println("next", next)
	jsons, _ := json.Marshal(dicts)
	fmt.Println("dict", jsons)
}
